import React from 'react';
import logo from './logo.svg';
import './App.css';
import "bootstrap/dist/css/bootstrap.min.css";

class App extends Component {
  render() {
  return (
    <div className="container">
      <div className="row">
        <div className="col-6">Col 1</div>
        <div className="col-6">Col 2</div>
      </div>
    </div>
  );
}
}

export default App;
